						<div itemprop="articleBody">
		<p>Bestyrelsen har afholdt møde den. 25.2.2010 med henblik på dagsorden m.v. for <strong>Årsmødet den 28.4.2010</strong>. Det bliver spændende at høre vort medlem Sajida Afzal fortælle om sit liv som kvindelig læge med anden etnisk baggrund og om sit projekt med et børnehospital i Pakistan.</p>
<p>Vi håber i bestyrelsen, at rigtig mange vil komme og bakke op omkring Sajida den dag.</p>
<p>Agnete Basbøll</p>	</div>

	
